import React from 'react';
import { Formik, Field, Form } from 'formik';
import axios from 'axios';
import { useHistory } from 'react-router-dom/cjs/react-router-dom.min';

const Sineupform = () => {
    const history = useHistory();

    return (
        <>
            <div className='container'>
                <h1>Sign Up</h1>
                <Formik
                    initialValues={{
                        fristname: '',
                        lastname: '',
                        email: '',
                        password: ''
                    }}
                    onSubmit={async (values) => {
                        axios.post('http://localhost:3000/sineup', values)
                            .then(function (response) {
                                // handle success
                                console.log(response);
                                localStorage.setItem('token', response.data.token)
                            })
                            .catch(function (error) {
                                // handle error
                                console.log(error);
                            })
                    }}
                >
                    <Form >
                        <label htmlFor="fristname">First Name</label>
                        <Field id="fristname" name="fristname" placeholder="enter frist name" />
                        <br /><br />
                        <label htmlFor="lastname">Last Name</label>
                        <Field id="lastname" name="lastname" placeholder="enter last name" />
                        <br /><br />
                        <label htmlFor="email">Email</label>
                        <Field
                            id="email"
                            name="email"
                            placeholder="enter email"
                            type="email"
                        />
                        <br /><br />
                        <label htmlFor="password">Password</label>
                        <Field
                            id="password"
                            name="password"
                            placeholder="enter password"
                            type="password"
                        />
                        <br /><br />
                        <button type="submit">Submit</button>
                        <button onClick={()=>history.push('/login')}>login</button>
                    </Form>
                </Formik>
            </div>
        </>
    )
}

export default Sineupform
